/*
 * https://leetcode.com/problems/remove-duplicates-from-sorted-array/
 * 题目：给定一个递增的数组，移除其中的重复元素，返回不重复元素的个数。要求：
 *      (1) in-place
 *      (2) 不要改变相对位置
 *     如输入为 [1,1,3,4]，处理后数组变为：[1,3,4,_]，返回 K=3。 _ 的位置 code judge 不关心
 *       输入为 [1,1,2,2,3,4,5] 处理后数组变为：[1,2,3,4,5,_,_]，返回K=5
 * 思路：
 *    其实就是实现一下 std::unique 函数。
 *    其实比 std::unique 更简单，std::unique 会把重复的数放到末尾。本题则没有这个要求，重复的数可以放到末尾，也可以直接丢掉。
 */
#include <iostream>
#include <chrono>
using namespace std;

// Accepted 17 ms 29.89%
// 思路1：直接使用 std::unique
class Solution {
public:
    int removeDuplicates(vector<int>& nums) {
        auto last = std::unique(nums.begin(), nums.end()); // std::unique 返回最后一个不重复的数的后一位
        return last - nums.begin();                        // 即[1,1,2,3] => [1,2,3,1], last 指向 3 后面的1
    }
};

// Time Limit Exceeded
// 思路2：发现重复，就把重复位置后面所有数迁移一位，再把重复的数放到末尾
// 效率低，反复的移动数据
class Solution2 {
public:
    int removeDuplicates(vector<int>& nums) {
        // 总共需要判断 nums.size() - 1 个数，用 cnt 记录判断次数
        // 从第二个数开始判断是否重复。i 记录当前要判断的位置
        int nRepeatCnt = 0;
        for(int i = 1, cnt = 1; cnt < nums.size(); cnt++){
            if(nums[i] == nums[i-1]){ // 发现重复数字
                int n = nums[i];
                for(int j = i; j < nums.size()-1; j++) nums[j] = nums[j+1]; // 后移
                nums[nums.size()-1] = n; // 当前数字放到末尾
                nRepeatCnt++;
                // i 不动，继续判断 i 位置的数
            }else{
                i++;
            }
        }

        return nums.size() - nRepeatCnt;
    }
};

// Accepted 12ms Beats 64.95%
// 思路3：手动实现 std::unqiue 函数
//       算法：发现一个不重复数字就依次从开头往后放，和思路4 本质是一样的
class Solution3 {
public:
    int removeDuplicates(vector<int>& nums) {
        auto last = myunique(nums.begin(), nums.end()); // std::unique 返回最后一个不重复的数的后一位
        return last - nums.begin();
    }

    template<typename ForwardIterator>
    ForwardIterator myunique(ForwardIterator first, ForwardIterator last){
        if (first==last) return last;
        auto result = first;      // 记录当前最后一个不重复的值的位置，初始时为 first
        while (++first != last)   // 从 first 的下一个位置开始，不断往后，判断当前值(first) 是否和
        {
            if (!(*result == *first))  // or: if (!pred(*result,*first)) for version (2)
                *(++result)=*first;
        }
        return ++result;
    }
};

// 思路4：发现一个不重复数字就依次从开头往后放
class Solution4 {
public:
    int removeDuplicates(vector<int>& nums) {
        if(nums.size() == 0) return 0;

        int p = 0; // p 指向当前数组中最后一个不同的数字，初始指向数组第0位
        for(int i = 1; i < nums.size(); i++){
            // 发现新的数字，放到p中
            if( nums[i] != nums[p]) {
                p ++;
                nums[p] = nums[i];
            }
        }

        return p + 1;
    }
};


